import logo from './logo.svg';
import './App.css';
import Toggle from './Toggle';
import ContactsList from './ContactsList'

class App extends Component {

    constructor(props) {
        super(props);
        console.log('constructor');
    }

    componentWillMount() {
        console.log('will mount');
    }

    componentDidMount() {
        console.log('mounted');
    }


  render() {
    return (
      <div className="App">
        <header className="App-header">
            <h1>Contacts List</h1>
            <ContactsList/>
        </header>
      </div>
    );
  }
}

export default App;
